import logo from './logo.svg';
import pointerCustomsLogo from './images/PointerCustomsLogo.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="App-header" style={{ backgroundImage: `url(${pointerCustomsLogo})` }}>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </div>
    </div>
  );
}

export default App;
